/* eslint-disable react/style-prop-object */
import { Link } from "react-router-dom";
import "./App.css";

function HorizontalMovies({ moviesList }) {
  const img_URL = "https://image.tmdb.org/t/p/w500";
  return (
    <>
      <div class="container horizontal-scroll-movie">
        <div class="row text-center row-cols-3 row-cols-lg-5">
          {moviesList &&
            moviesList.length > 0 &&
            moviesList.map((movie, index) => (
              <div class="col me-4 px-0">
                <div
                  class="card my-4 p-1 movie-card-custom rounded-4"
                  key={movie.id}
                >
                  <Link to={`/movie/${movie.id}`}>
                    <img
                      src={img_URL + movie.poster_path}
                      class="img-fluid rounded-4 "
                      alt={movie.title}
                    />
                  </Link>
                  <div class="container">
                    <div class="row row-cols-2">
                      <div class="col">Column</div>
                      <div class="col">Column</div>
                      <div class="col">Column</div>
                      <div class="col">Column</div>
                    </div>
                  </div>
                  <h5 class="card-title mt-2 ms-2 text-wrap text-start">
                    {movie.title}
                  </h5>
                </div>
              </div>
            ))}
        </div>
      </div>
    </>
  );
}

export default HorizontalMovies;
